import React from "react";
import { styled } from "styled-components";

const Wrapper = styled`
.admin{
    display: flex;
    color: white;
    justify-content: flex-end;
    padding-right: 20px;
    background-image: linear-gradient(to right, rgb(78, 59, 97), rgb(13, 128, 32),rgb(78, 59, 97),rgb(78, 59, 97));
}
.h-icon{
    padding-right: 5px;
}
.admin div{
    margin: 5px;
}
.admin div a{
    text-decoration: none;
    color: inherit;
    font-size: 10px;
    font-weight: 500;
    
}
.admin div a:hover{
color: rgb(177, 211, 84);
}
.bg-light{
    background-color: white !important;
    /* background-image: linear-gradient(to right, blue, rgb(155, 170, 240), blue) !important; */
    box-shadow: 5px 5px 5px 5px #eee6e6;
    
}
.nav-link, .navbar-brand{
  color: var(--primary-color);
  font-weight: 700;
  font-family: 'Times New Roman', Times, serif;
}
.nav-link:hover{
    color: rgb(177, 211, 84);
    }

/* for medium screen */
@media only screen and (min-width: 768px) {
    .admin div{
        margin: 10px;
    }
    .admin div a{
        font-size: 14px;
    }

}
`;

function Header({ user }) {
  return (
    <>
      <Wrapper class="admin">
        {user && user.isAdmin && (
          <>
            <div>
              <a href="/post/admin">
                <i class="fa-solid h-icon fa-user"></i>Admin
              </a>
            </div>
            <div>
              <a href="/auth/logout">
                <i class="h-icon"></i>Logout
              </a>
            </div>
          </>
        )}
        {user && (
          <div>
            <a href="/auth/logout">
              <i class="h-icon"></i>Logout
            </a>
          </div>
        )}
        {!user && (
          <>
            <div>
              <a href="/auth/register">
                <i class="fa-solid h-icon fa-book"></i>Sign Up
              </a>
            </div>
            <div>
              <a href="/auth/login">
                <i class="fa-solid h-icon fa-user"></i>Sign In
              </a>
            </div>
          </>
        )}
      </Wrapper>
      <nav className="navbar navbar-expand-sm sticky-top navbar-dark bg-dark">
        <div className="container-fluid">
          <button
            className="navbar-toggler"
            type="button"
            data-bs-toggle="collapse"
            data-bs-target="#navbarTogglerDemo02"
            aria-controls="navbarTogglerDemo02"
            aria-expanded="false"
            aria-label="Toggle navigation"
          >
            <span className="navbar-toggler-icon"></span>
          </button>
          <div className="collapse navbar-collapse" id="navbarTogglerDemo02">
            <ul className="navbar-nav mx-auto mb-2 mb-lg-0">
              <li className="nav-item">
                <a className="nav-link" href="/">
                  Home
                </a>
              </li>

              {user && (
                <>
                  <li className="nav-item">
                    <a className="nav-link" href="/profile">
                      Profile
                    </a>
                  </li>
                  <li className="nav-item">
                    <a className="nav-link" href="/logout">
                      logout
                    </a>
                  </li>
                </>
              )}

              {!user && (
                <>
                  <li className="nav-item">
                    <a className="nav-link" href="/register">
                      Register
                    </a>
                  </li>
                  <li className="nav-item">
                    <a className="nav-link" href="/login">
                      Login
                    </a>
                  </li>
                </>
              )}
            </ul>
          </div>
        </div>
      </nav>
    </>
  );
}

export default Header;
